    this.state = {
    };
  }

  render() {
    return (
      <div id="main">
        <Square Id="A" latlng={{latitude:0.0,longitude:0.0}}/>
        <Square Id="B" latlng={{latitude:0.0,longitude:0.0}}/>
        <Square Id="C" latlng={{latitude:0.0,longitude:0.0}}/>
      </div>
    );
  }
}

export default App;
